<div id="page-container">
<div id="pf3" class="pf w0 h9" data-page-no="3"><div class="pc pc3 w0 h9"><img class="bi x0 y0 w1 ha" alt src="data:image/png;base64," /><div class="t m0 x1 hb y2f ffd fs0 fc0 sc0 ls0 ws0"><span class="fc5 sc0">Honeydew</span></div><div class="t m0 xa hc y30 ffe fs5 fc0 sc0 ls38 ws0"><span class="fc5 sc0">104</span><span class="_ _4"></span><span class="fc5 sc0">104</span></div><div class="t m0 xa hc y31 ffe fs5 fc0 sc0 ls38 ws0"><span class="fc5 sc0">104</span><span class="_ _4"></span><span class="fc5 sc0">104</span></div><div class="t m0 xa hc y32 ffe fs5 fc0 sc0 ls38 ws0"><span class="fc5 sc0">104</span></div><div class="t m0 xb hd y33 fff fs6 fc2 sc0 ls39 ws29"><span class="fc5 sc0">Before you read</span></div><div class="t m0 xb h5 y34 ff10 fs4 fc0 sc0 ls3a ws2a"><span class="fc5 sc0">Do you know what a diary is? It is a record of personal</span></div><div class="t m0 xb h5 y35 ff10 fs4 fc0 sc0 ls3b ws2b"><span class="fc5 sc0">experiences written day after day over a long period</span></div><div class="t m0 xb h5 y36 ff10 fs4 fc0 sc0 ls3c ws2c"><span class="fc5 sc0">of time. Y</span><span class="_ _1"></span><span class="ls3d"><span class="fc5 sc0">ou can also use a diary to note down things</span></span></div><div class="t m0 xb h5 y37 ff10 fs4 fc0 sc0 ls3e ws2d"><span class="fc5 sc0">you plan to do immediately or in future.</span></div><div class="t m0 xb h5 y38 ff10 fs4 fc0 sc0 ls3f ws15"><span class="fc5 sc0">One of the most famous diaries published as a book is</span></div><div class="t m0 xb h5 y39 ff11 fs4 fc0 sc0 ls40 ws2e"><span class="fc5 sc0">The Diary of Anne Frank</span><span class="ff10 ls2"><span class="fc5 sc0">.</span></span></div><div class="t m0 xb h5 y3a ff10 fs4 fc0 sc0 ls41 ws2f"><span class="fc5 sc0">Here are a few extracts from Ruskin Bond’s diary in</span></div><div class="t m0 xb h5 y3b ff10 fs4 fc0 sc0 lsb ws30"><span class="fc5 sc0">which he portrays the silent miracles of nature and</span></div><div class="t m0 xb h5 y3c ff10 fs4 fc0 sc0 ls42 ws31"><span class="fc5 sc0">life’s little joys and regrets. Read on.</span></div><div class="t m0 xc he y3d ff12 fs7 fc1 sc0 ls43 ws0"><span class="fc5 sc0">I</span></div><div class="t m0 xd h8 y3e ff13 fs4 fc0 sc0 ls44 ws32"><span class="fc5 sc0">June 24</span></div><div class="t m0 xd hd y3f ff14 fs6 fc0 sc0 ls45 ws33"><span class="fc5 sc0">The first day of monsoon mist. And it’s strange how all</span></div><div class="t m0 xd hd y40 ff14 fs6 fc0 sc0 ls46 ws34"><span class="fc5 sc0">the birds fall silent as the mist comes climbing up the</span></div><div class="t m0 xd hd y41 ff14 fs6 fc0 sc0 ls47 ws35"><span class="fc5 sc0">hill. Perhaps that’s what makes the mist so melancholy;</span></div><div class="t m0 xd hd y42 ff14 fs6 fc0 sc0 ls48 ws36"><span class="fc5 sc0">not only does it conceal the hills, it blankets them in</span></div><div class="t m0 xd hd y43 ff14 fs6 fc0 sc0 ls49 ws37"><span class="fc5 sc0">silence too. Only an hour ago the trees were ringing</span></div><div class="t m0 xd hd y44 ff14 fs6 fc0 sc0 ls4a ws38"><span class="fc5 sc0">with birdsong. And now the forest is deathly still as</span></div><div class="t m0 xd hd y45 ff14 fs6 fc0 sc0 ls4b ws39"><span class="fc5 sc0">though it were midnight.</span></div><div class="t m0 xe hd y46 ff14 fs6 fc0 sc0 ls2 ws39"><span class="fc5 sc0">Thr</span><span class="ls4c ws3a"><span class="fc5 sc0">ough the mist Bijju is calling to his sister</span><span class="_ _2"></span><span class="ls4d"><span class="fc5 sc0">. I can</span></span></span></div><div class="t m0 xd hd y47 ff14 fs6 fc0 sc0 ls4e ws3b"><span class="fc5 sc0">hear him running about on the hillside but I cannot</span></div><div class="t m0 xd hd y48 ff14 fs6 fc0 sc0 ls49 ws3c"><span class="fc5 sc0">see him.</span></div><div class="t m0 xf hf y49 ff15 fs8 fc3 sc0 ls4f ws0"><span class="fc5 sc0">melancholy:</span></div><div class="t m0 xf hf y4a ff15 fs8 fc0 sc0 ls50 ws3d"><span class="fc5 sc0">very sad (the</span></div><div class="t m0 xf hf y4b ff15 fs8 fc0 sc0 lsa ws17"><span class="fc5 sc0">mist is called</span></div><div class="t m0 xf hf y4c ff15 fs8 fc0 sc0 ls51 ws17"><span class="fc5 sc0">melancholy</span></div><div class="t m0 xf hf y4d ff15 fs8 fc0 sc0 ls52 ws3e"><span class="fc5 sc0">because it</span></div><div class="t m0 xf hf y4e ff15 fs8 fc0 sc0 ls53 ws3f"><span class="fc5 sc0">makes people</span></div><div class="t m0 xf hf y4f ff15 fs8 fc0 sc0 ls2 ws3f"><span class="fc5 sc0">feel</span></div><div class="t m0 xf hf y50 ff15 fs8 fc0 sc0 ls54 ws3f"><span class="fc5 sc0">melancholy)</span></div><div class="t m0 xf hf y51 ff15 fs8 fc3 sc0 ls55 ws0"><span class="fc5 sc0">blankets:</span></div><div class="t m0 xf hf y52 ff15 fs8 fc0 sc0 ls2 ws0"><span class="fc5 sc0">covers</span></div><div class="c x5 y53 w2 h6"><div class="t m0 x0 h7 y20 ff16 fs0 fc4 sc0 ls2 ws0"><span class="fc5 sc0">Rationalised </span><span class="fc5 sc0">2023-24</span></div></div></div><div class="pi" data-data="{&quot;ctm&quot;:[1.000000,0.000000,0.000000,1.000000,0.000000,-16.739300]}"></div></div>
</div>
